import "./TodoSearch.css"
import React from 'react'

function TodoSearch(props) {{
    searchValue,
    setsearchValue
}
    return(
       <input 
       className="TodoSearch" 
       placeholder="TodoSearch"
       value ={searchValue} 
       onChange={(event) => {
        setsearchValue(event.target.value)
       }}></input>
    )
}

export {TodoSearch}
